const layoutStyle = { 
    margin: 20, 
    padding: 20, 
    border: '1px solid #DDD'
  }

  export const Layout = (props) => (
    <div style={layoutStyle}>
      <p>rendered by: {getRenderedBy()}</p>
      {props.children}
    </div>
  )

  export function getRenderedBy() {
    return (typeof window !== 'undefined' && window.document) ? 'client' : 'server';
  }
